nd Tuesdays are the days when the most steps and taken and the most Calories is being burned. This insight can also be used to create a marketing strategy to get the users to move more during the week and burn more calories.\n","\n","* The users that wear their devices to bed and spend more time in bed will see that they spend more time asleep. This insight can also be used to create a marketing strategy to get new customers to buy the product and get more exsiting users to use the product while in Bed."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":10.481583,"end_time":"2023-01-13T05:41:23.227247","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-01-13T05:41:12.745664","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}